import React from "react";
import ReactDelayRender from "react-delay-render";
import FadeIn from "react-fade-in";

import kolorkiIMG from "../../../../../assets/projects/kolorki.PNG";
import budgetIMG from "../../../../../assets/projects/kolorki.PNG";
import tdeeCalc from "../../../../../assets/projects/kolorki.PNG";
import forkify from "../../../../../assets/projects/kolorki.PNG";
import burgerIMG from "../../../../../assets/projects/kolorki.PNG";

import ProjectItem from "./ProjectItem/ProjectItem";

import "./Projects.css";

const Projects = () => {
  return (
    <FadeIn>
      <div className="projects__wrapper">
        <p className="projects__paragraph">{/* maybe nothing? */}</p>
        <div className="projects__list">
          <ProjectItem
            triggerTitle="Color Game"
            alt={"colourGame"}
            img={kolorkiIMG}
          >
            Simple DOM manipulation game where the user is challenged to guess
            the color by the RGB values.
          </ProjectItem>
          <ProjectItem
            triggerTitle="Color Game"
            alt={"colourGame"}
            img={kolorkiIMG}
          >
            Simple DOM manipulation game where the user is challenged to guess
            the color by the RGB values.
          </ProjectItem>
          <ProjectItem
            triggerTitle="Color Game"
            alt={"colourGame"}
            img={kolorkiIMG}
          >
            Simple DOM manipulation game where the user is challenged to guess
            the color by the RGB values.
          </ProjectItem>
          <ProjectItem
            triggerTitle="Color Game"
            alt={"colourGame"}
            img={kolorkiIMG}
          >
            Simple DOM manipulation game where the user is challenged to guess
            the color by the RGB values.
          </ProjectItem>
        </div>
      </div>
    </FadeIn>
  );
};

export default ReactDelayRender({ delay: 401 })(Projects);
